like falling into a spinning abyss of numbers and symbols. Just thinking about it seemed like an abuse of my brain. However, my entire tuition was financed by an academic scholarship, so I had to maintain high marks in all of my classes, including Math.\r\n\r\nMy most abstruse class was Advanced Calculus Mathematics. It was taught in a large lecture hall which abutted the North access gate of the University. Unlike the many absentees in my class who often abstained from attending the boring lectures, I dared not absolve myself from this responsibility. Any degree of absenteeism would probably cause me to fail Math and to lose my scholarship. I was so afraid of failing that even pledged abstinence from my abundant supply of alcohol. It wasn&rsquo;t until the fourth week of Math class that I met the wonderful person who would accelerate my intereset and understanding of this absurd subject. She was a foreign exchange student from Beijing. She was also a brilliant mathematician. She would come to class everyday in a colorful silk scarf that accentuated her lovely smile.\r\n\r\nIt was so nice to meet someone from my home country. She inspired me to love Math. Althought we now live and teach in different countries, I still see her smiling face between every number I write!', 'http://pa5vtka0q.bkt.clouddn.com/teacher/image/2018/7/9/ae00792e2d8f4254aef0aa3ee7ee3acd.jpg', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/7/9/6da0753b63bc4bf68eba4da2a5333657.mp3', 'absenteeism n. 旷课，旷工 absentee n. 缺席者 absolve v. 1.（宗教上的）宽恕 2. 赦免（罪行、过失等），解除（责任等） absorb vt. 1. 吸收（液体、知识等） 2. 理解、掌握 absorbing adj. 吸引人的，引人入胜的 abstain v. 自制、自动放弃，戒绝，有意回避 abstinence n. 自制，节制（禁欲、戒酒） abstract adj. 1. 抽象的 2. 难解的，深奥的 abstraction n. 抽象（概念）\r\n\r\nabstruse adj. 难懂的，深奥的 absurd adj. 荒谬的，可笑的 abundant adj. 丰富的，充裕的；大量的 abuse n. （权利等的）滥用；（物品的）不精心使用 abut vi. 邻接，毗邻 abyss n. 深渊，深坑 academic adj. 学术的；学院的；理论的 academician n. 学会会员；院士；学者 accelerate v. 1.加快，加速 2. 促进，促使&hellip;&hellip;早日发生 accentuate v. 突出，强调 access n