INSERT INTO `lession_info` VALUES ('1a4bdd4dcf6d46c394842b3b376fbf52', 'You can call me AJ', 'You can call me A.J., which is an abbreviation of my full name, Alexander Justice. I like to abbreviate my name because it\'s easier for people to remember. I work for a museum that collects aboriginal artifacts.\r\n\r\nI would like to tell you why I have an abiding faith in the legal system. The story you\'re about to read has been abridged to reduce its length.\r\n\r\nI used to live in an area where criminals abounded and where the legal system seemed powerless. One day, my daughter was abducted. Although I abided by the kidnapper\'s monetary demands, they refused to release her. I had no choice but to put my faith in the legal authorities. The police responded immediately and searched the area. Despited their lack of success, they refused to abandon their search or to call an abort to their mission. They knew that any abortive action would surely result in my daughter\'s death.\r\n\r\nThe investigation eventually led the police to conduct an abrupt search at the home of a local official who was abashed when he learned of the search. My daughter was found in his basement. She had abrasions to her wrists where the abrasive rope had scraped her. The official was arrested along with his bodyguard who abetted him in the kidnapping.\r\n\r\nThe official was forced to abdicate his position and was sent to prision for life. The judge told him that he was lucky that captial punishment had been abolished and that it was only due to this abolition that he would not be executed. The swift apprehension and strict punishment of these criminals helped to abate my lack of faith in the legal system. These days, I truly believe in &quot;justice&quot;, and it\'s not because of my name!', 'http://pa5vtka0q.bkt.clouddn.com/teacher/image/2018/7/9/406613ea164a4be895dd3d7e9e8927c3.jpg', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/7/9/2e09df232456474ab942b9788137b902.mp3', 'abandon vt. 