INSERT INTO `lession_info` VALUES ('24240f6271cd405ca1b0c176c7c185eb', 'Love of Numbers', 'As an academician, I think Mathematics is an intriguing and absorbing science. However, many of my students consider it an abstract science and they hate it because the equations are too difficult to absorb and to remember. I think my students would laugh if they know how I became so interested in Math. When I was a freshman in college, I also believed Math was a mere abstraction. Studying it was\r\n\r\nINSERT INTO `lession_info` VALUES ('3097c5478fd24e3ebe863bd2ca2f0455', '初一', '少时诵诗书所所所', 'http://pa5vtka0q.bkt.clouddn.com/teacher/image/2018/6/12/3097c5478fd24e3ebe863bd2ca2f0455', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/6/12/3097c5478fd24e3ebe863bd2ca2f0455', '第三代', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/6/12/3097c5478fd24e3ebe863bd2ca2f0455', '1', 3, '213083ee0c1c43d594705a4f708a4e20', '1', '2018-06-12 15:44:06.060');
